import { Injectable } from '@angular/core';
import { HttpResponse } from '@angular/common/http';
import { Resolve, ActivatedRouteSnapshot, Router } from '@angular/router';
import { Observable, of, EMPTY } from 'rxjs';
import { mergeMap } from 'rxjs/operators';

import { IOrganizationStarRating, OrganizationStarRating } from '../organization-star-rating.model';
import { OrganizationStarRatingService } from '../service/organization-star-rating.service';

@Injectable({ providedIn: 'root' })
export class OrganizationStarRatingRoutingResolveService implements Resolve<IOrganizationStarRating> {
  constructor(protected service: OrganizationStarRatingService, protected router: Router) {}

  resolve(route: ActivatedRouteSnapshot): Observable<IOrganizationStarRating> | Observable<never> {
    const id = route.params['id'];
    if (id) {
      return this.service.find(id).pipe(
        mergeMap((organizationStarRating: HttpResponse<OrganizationStarRating>) => {
          if (organizationStarRating.body) {
            return of(organizationStarRating.body);
          } else {
            this.router.navigate(['404']);
            return EMPTY;
          }
        })
      );
    }
    return of(new OrganizationStarRating());
  }
}
